function captureScreenshot(videoElement) {
    return new Promise((resolve, reject) => {
        html2canvas(videoElement).then((canvas) => {
            const dataUrl = canvas.toDataURL("image/png");
            resolve(dataUrl); // Return the base64 image URL
        }).catch((error) => {
            console.error("Error capturing screenshot:", error);
            reject(error);
        });
    });
}

function startThumbnailCapture(videoElement, socket) {
    setTimeout(async () => {
        const screenshot = await captureScreenshot(videoElement);
        socket.emit("thumbnailScreenshot", { image: screenshot });
        console.log("Thumbnail captured and sent to the server");
    }, 10000);
}

